package org.gbif.pipelines.core.utils;

import java.util.Collections;
import java.util.Optional;
import org.gbif.dwc.terms.DwcTerm;
import org.gbif.pipelines.io.avro.ExtendedRecord;
import org.junit.Assert;
import org.junit.Test;

public class ModelUtilsTest {

  @Test
  public void longValueLenghtTest() {
    // State
    String value =
        "";
    ExtendedRecord record =
        ExtendedRecord.newBuilder()
            .setId("777")
            .setCoreTerms(
                Collections.singletonMap(DwcTerm.previousIdentifications.qualifiedName(), value))
            .build();

    // When
    Optional<String> string =
        ModelUtils.extractLengthAwareOptValue(record, DwcTerm.previousIdentifications);

    // Should
    Assert.assertFalse(string.isPresent());
  }

  @Test
  public void shortValueLenghtTest() {
    // State
    String value = "awdawdawd";
    ExtendedRecord record =
        ExtendedRecord.newBuilder()
            .setId("777")
            .setCoreTerms(
                Collections.singletonMap(DwcTerm.previousIdentifications.qualifiedName(), value))
            .build();

    // When
    Optional<String> string =
        ModelUtils.extractLengthAwareOptValue(record, DwcTerm.previousIdentifications);

    // Should
    Assert.assertTrue(string.isPresent());
  }
}
